import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';



class Random extends React.Component {

  render() {
    return(
      <div>test</div>
    );
  }

}

class AppBar extends React.Component {

  render() {
    return(
      <div
      style={{
        display: 'flex',
        justifyCotent: 'Right',
        alignItems: 'Right',
        height: '100vh'
      }}
      >
      <h1>DNIYM</h1>
      </div>
    );
  }

}


ReactDOM.render(
  <Random />,
document.getElementById('root')
);
